import React from 'react';
import NFTCard from './NFTCard.jsx'

function Gallery(props) {
    console.log(props.nftList);
    let cardList = [];
    if(props.nftList!==[]) {
        props.nftList.forEach((nft) =>{
            cardList.push(<NFTCard imgURL={nft.media[0].gateway} name={nft.title}></NFTCard>)
        })
    }
    return (
        {cardList}
    );
}
export default Gallery;
